function init_param()
{
  var param = {
  'accountingBasicCurrency' : '',
  'companyId' : '',
  'identifierScheme' : 'http://scheme.xbrl.org',
  };
  
  if (Banana.document)
  {
    param.accountingBasicCurrency = Banana.document.info("AccountingDataBase", "BasicCurrency");
    var company = '';
    if (Banana.document.info("AccountingDataBase","Company").length) {
      company = Banana.document.info("AccountingDataBase","Company");
    }
    if (Banana.document.info("AccountingDataBase","Name").length || Banana.document.info("AccountingDataBase","FamilyName").length) {
      company = Banana.document.info("AccountingDataBase","Name") + ' ' + Banana.document.info("AccountingDataBase","FamilyName");
    }
    param.companyId = company;
  }
 
  param.schemaRefs = init_schemarefs();
  param.namespaces = init_namespaces();
  param.taxonomy = init_taxonomy();
  param.accounts = init_accounts();
  param.factVariables = init_factvariables();
  return param;
}
function checkAccounts(context, accounts)
{
  var currentDocument = context.document;
  if (!currentDocument)
    return;
	
  var tableAccounts = currentDocument.table('Accounts');
  if (!tableAccounts)
    return;

  var fileName = currentDocument.info("Base","FileName");

  for (var i = 0; i < tableAccounts.rowCount; i++) 
  {
	var accountId = tableAccounts.value(i, "DatevAccount");
	if (accountId === undefined || accountId.length<=0)
		accountId = tableAccounts.value(i, "Account");
	if (accountId.length<=0)
	  continue;
	var formattedAccountId = accountId.replace(/^0+/, '');
	var accountsList = getAccountsWithAccountId(formattedAccountId, accounts);
	if (accountsList.length<=0)
	{
	  //check amount, if balance is empty no warning is made
      var currentBal = currentDocument.currentBalance(accountId, context.startdate, context.enddate);
      if (currentBal.total!=0 || currentBal.balance!=0)
	  {
        var msg = getErrorMessage(ID_ERR_XBRL_MISSING);
        msg = msg.replace("%1", accountId );
        msg = msg.replace("%2", fileName);
        Banana.document.table('Accounts').addMessage(msg, i, "Account", ID_ERR_XBRL_MISSING);
	  }
	}
  }
}

function getAccountingData(param, contextList)
{  
  for (var i in contextList)
  {
    checkAccounts(contextList[i], param.accounts);
  }  
  
  for (var role in param.taxonomy)
  {
    for (var i in contextList)
    {
      initContext(param.taxonomy[role], contextList[i]['name']);
      loadAmounts(param.taxonomy[role], contextList[i], param.accounts);
      loadNetIncomeLoss(role, contextList[i], param);
	  if (role == 'role_balanceSheet')
		sum_role_balanceSheet(contextList[i]['name'], param.taxonomy);
	  else if (role == 'role_incomeStatement')
		sum_role_incomeStatement(contextList[i]['name'], param.taxonomy);
    }
  }

}

function getAccountsWithXbrlId(xbrlId, accounts)
{
  return accounts.filter(function(el) {
	return (el.debit === xbrlId || el.credit === xbrlId);
  });
}

function getAccountsWithAccountId(accountId, accounts)
{
  return accounts.filter(function(el) {
    return el.accountid === accountId;
  });
}

function initContext(roleObject, contextname)
{
  if (roleObject === undefined)
    return;
  for (var key in roleObject)
  {
    if (typeof roleObject[key] === 'object')
    {
      roleObject[key][contextname] = 0;
    };
  };
}

function loadAmounts(roleObject, context, accounts)
{
  if (roleObject === undefined || context === undefined)
    return;
  var accStartDate = context.startdate;
  var accEndDate = context.enddate;
  var contextName = context.name;
  var currentDocument = context.document;
  
  if (!currentDocument)
    return;

  var tableAccounts = currentDocument.table('Accounts');
  if (!tableAccounts)
    return;

  for (var i = 0; i < tableAccounts.rowCount; i++) 
  {
	var accountId = tableAccounts.value(i, "Account");
	var bClass = tableAccounts.value(i, "BClass");
	if (accountId === undefined || accountId.length<=0)
	  continue;

    var currentBal = currentDocument.currentBalance(accountId, accStartDate, accEndDate);
    if (currentBal.balance==0 && currentBal.total==0)
	  continue;
	  
	var accountIdDatev = tableAccounts.value(i, "DatevAccount");
	if (accountIdDatev)
	  accountId=accountIdDatev;
    accountId = accountId.replace(/^0+/, '');
	var accountsList = getAccountsWithAccountId(accountId, accounts);
	if (accountsList.length <= 0)
	  continue;
	  
	var xbrlIdDebit = '';
	var xbrlIdCredit = '';
	
	if (accountsList[0].debit)
		xbrlIdDebit = accountsList[0].debit;
	if (accountsList[0].credit)
		xbrlIdCredit = accountsList[0].credit;
	// it is the same if specified only xbrlIdDebit or xbrlIdCredit
	if (!xbrlIdDebit && xbrlIdCredit) {
		xbrlIdDebit = xbrlIdCredit;
	}
	
	var periodtype = '';
	var xbrlCurrent = xbrlIdDebit;
	// we assume period is same for xbrlIdDebit and xbrlIdCredit
	if (roleObject[xbrlCurrent]){
		periodtype = roleObject[xbrlCurrent].periodtype;
	}
	else {
		// var fileName = currentDocument.info("Base","FileName");
        // var msg = getErrorMessage(ID_ERR_XBRL_NOTFOUND);
        // msg = msg.replace("%1", accountId );
        // msg = msg.replace("%2", xbrlCurrent );
        // msg = msg.replace("%3", fileName);
        // Banana.document.table('Accounts').addMessage(msg, i, "Account", ID_ERR_XBRL_NOTFOUND);
		continue;
	}
	var amount = currentBal.balance;
	if (periodtype == 'duration') 
		amount = currentBal.total;
	if ( xbrlIdCredit && amount < 0)  {
		xbrlCurrent = xbrlIdCredit;
	}
	if (roleObject[xbrlCurrent] && roleObject[xbrlCurrent].balance == 'credit') {
		amount = amount*-1;
	}
	if (roleObject[xbrlCurrent])
	{
		amount = amount*roleObject[xbrlCurrent].weight;
		amount = Banana.SDecimal.round(amount, {'decimals':2});
		roleObject[xbrlCurrent][contextName] = Banana.SDecimal.add(roleObject[xbrlCurrent][contextName], amount);
	}
  }
}

function loadNetIncomeLoss(role, context, param)
{
  if (role.length<=0 || context === undefined)
    return;

  var accStartDate = context.startdate;
  var accEndDate = context.enddate;
  var contextName = context.name;
  var currentDocument = context.document;
  
  if (!currentDocument)
    return;

  //TODO: not compatible with journal and period
  /*var netIncomeLossGroup = param.netincomeLossGroup;
  var currentBalance = currentDocument.currentBalance("Gr="+netIncomeLossGroup, accStartDate, accEndDate);*/
  var tableTotals = currentDocument.table('Totals');
  var currentBalance=0;
  if (tableTotals)
  {
    for (var i = 0; i < tableTotals.rowCount; i++) 
    {
      var groupId = tableTotals.value(i, "Group");
	  if (groupId=="02")
	  {
        currentBalance = tableTotals.value(i, "Balance")*-1;
	    break;
	  }
    }
  }
  
  for (var i in param.factVariables)
  {
    var variableName = param.factVariables[i].name;
    var elementRole = param.factVariables[i].role;
	var elementid = param.factVariables[i].elementid;
    if ( variableName == "VARIABLE_NETINCOMELOSS" && elementRole == role && elementid.length>0)
	{
	  if (param.taxonomy[role][elementid])
        param.taxonomy[role][elementid][contextName] = Banana.SDecimal.round(currentBalance, {'decimals':2});
	}
  }
  return;
}
function createInstance(param, contextList)
{
  var xbrlContent = '';
  var attrsIdentifier = {
	  scheme: param['identifierScheme']
  };  
  var xbrlIdentifier = xml_createElement("xbrli:identifier", param['companyId'], attrsIdentifier);

  for (var j in param['schemaRefs'])
  {
    if (param['schemaRefs'][j].length>0) {
      var attrsSchemaRef = {
      'xlink:type': 'simple',
      'xlink:href': param['schemaRefs'][j]
      };  
      xbrlContent += '\n' + xml_createElement("link:schemaRef", "", attrsSchemaRef);
    }
  }  

  for (var i in contextList)
  {
    var attrsInstant = {
	  id: "i-" + contextList[i].name
	};  
	var xbrlInstant = '\n' + xml_createElement("xbrli:instant", contextList[i].enddate) + '\n';
	var xbrlString = '\n' + xml_createElement("xbrli:entity", xbrlIdentifier);
	xbrlString += '\n' + xml_createElement("xbrli:period", xbrlInstant) + '\n';
    xbrlContent += '\n' + xml_createElement("xbrli:context", xbrlString, attrsInstant);

    var attrsDuration = {
	  id: "d-" + contextList[i].name
	};  
	var xbrlDuration = '\n' + xml_createElement("xbrli:startDate", contextList[i].startdate) + '\n';
	xbrlDuration += xml_createElement("xbrli:endDate", contextList[i].enddate) + '\n';
	xbrlString = '\n' + xml_createElement("xbrli:entity", xbrlIdentifier);
	xbrlString += '\n' + xml_createElement("xbrli:period", xbrlDuration) + '\n';
    xbrlContent += '\n' + xml_createElement("xbrli:context", xbrlString, attrsDuration);
  }   

  var accountingBasicCurrency = Banana.document.info("AccountingDataBase", "BasicCurrency");
  var accountingDecimals = Banana.document.info("Base", "DecimalsAmounts");
  var xbrlMeasure = '\n' + xml_createElement("xbrli:measure", "iso4217:"+accountingBasicCurrency) + '\n';
  var xbrlUnit = '\n' + xml_createElement("xbrli:unit", xbrlMeasure, {'id':'BaseCurrency'}) + '\n';
  xbrlContent += xbrlUnit;
 
  for (var role in param.taxonomy)
  {
    for (var object in param.taxonomy[role])
    {
      if (typeof param.taxonomy[role][object] === 'string')
        continue;
      var print = false;
      for (var i in contextList)
      {
        var contextname = contextList[i]['name'];
        if (param.taxonomy[role][object][contextname] != 0)
          print = true;
      }
      if (print == false)
        continue;

      for (var i in contextList)
      {
		var contextname = contextList[i]['name'];
	    if (param.taxonomy[role][object][contextname] != 0)
		{
		  var periodtype = param.taxonomy[role][object]['periodtype'];
		  if (periodtype.length>=1)
		    periodtype = periodtype.substr(0,1);
		  var contextref = periodtype + '-' + contextname;  
		  var attrs = {'contextRef':contextref,'unitRef':'BaseCurrency','decimals':accountingDecimals};
		  xbrlContent += xml_createElement(param.taxonomy[role][object]['qname'], Banana.SDecimal.round(param.taxonomy[role][object][contextname], {'decimals':2}), attrs) + '\n';
		}
      }
    }
  }
  var results = [];
  results.push("<?xml version='1.0' encoding='UTF-8'?>");
  
  var attrsNamespaces = {};
  for (var j in param.namespaces)
  {
    var prefix = param.namespaces[j]['prefix'];
	var namespace = param.namespaces[j]['namespace'];
	if (prefix.length > 0)
      attrsNamespaces[prefix] = namespace;
  }

  results.push(xml_createElement("xbrli:xbrl", xbrlContent, attrsNamespaces));
  return results.join ('\n');
   
}

/**
* ErrorId List
*/
var ID_ERR_XBRL_MISSING = "ID_ERR_XBRL_MISSING";
var ID_ERR_XBRL_NOTFOUND = "ID_ERR_XBRL_NOTFOUND";

/**
* return the text error message according to error id
*/
function getErrorMessage(errorId) {
    switch (errorId) {
        case ID_ERR_XBRL_MISSING:
            return "Das Konto %1 hat keine gültige Xbrl-Position und wird nicht berücksichtigt. Filename: %2";
        case ID_ERR_XBRL_NOTFOUND:
            return "Das Konto %1 hat keine gültige Xbrl-Position und wird nicht berücksichtigt. Xbrl-Position%2. Filename: %3";
    }
    return "";
}
